Thailand, 2022. De Thaise premier Traiphop besluit om het directeurschap van het &quot;Nationaal Rampen Centrum&quot; over te laten aan de befaamde geleerde Dr. Saim. Maar Dr. Siam ziet een zeebeving in de Indische Oceaan over het hoofd. Deze zeebeving veroorzaakt echter een gigantische Tsunami die heel Thailand van de kaart dreigt te vegen.

